import logo from './logo.svg';
import './App.css';
import Email from "./Component/Email";
import EmailBar from "./Component/EmailBar";

class App extends Component {
  render() {
    return (
      <div className="App">
            <EmailBar/>
      </div>
    );
  }
}

export default App;
